import styled from "styled-components";

const ProgressBar = styled.div`
    position: absolute;
    background: pink;
    height: 100%;
    width: 25%;
    left: 0;

    &:after {
        content: "";
        height: 100%;
        width: 0;
        background: pink;
        position: absolute;
        right: -20px;
        top: 0;
        border-left: 20px solid #ffad06;
    }

`;

export default ProgressBar;
